import logo from './logo.svg';
import './App.css';
import Header from './Components/Header/Header';
import NavBar from './Components/NavBar/NavBar';
import Profile from './Components/Profile/Profile';
import Dialogs from "./Components/Dialogs/Dialog";
import {BrowserRouter, Route} from "react-router-dom";

let DialogMessages = [
    {message : 'hi!'},
    {message : 'hello!'},
    {message : 'how ar u?'},
    {message : 'good! what bout u?'}
]

let DialogsProfiles = [
    {name: 'Alexey', profile_id: '1'},
    {name: 'Sasha', profile_id: '2'},
    {name: 'Anton', profile_id: '3'},
    {name: 'Valera', profile_id: '4'},
]

function App() {
    return (
        <BrowserRouter>
            <div className='app-wrapper'>
                <Header/>
                <NavBar/>
                <div className='app-wrapper-content'>
                    <Route path="/dialogs" render={() => <Dialogs DialogMessages = {DialogMessages} DialogsProfiles = {DialogsProfiles} />}/>
                    <Route path="/profile" render={() => <Profile />}/>
                </div>

            </div>
        </BrowserRouter>
    );
}

export default App;
